script: |
  super -f text -I q1689.spq | sort > q1689.out

inputs:
  - name: q1689.spq
    data: |
      SELECT + col0 FROM tab2 (FORMAT parquet) WHERE + 28 * + ( col0 ) * - ( - + 58 ) + + col2 + - 79 * + + col2 IS NOT NULL;
  - name: tab2

outputs:
  - name: q1689.out
    data: |
      46
      64
      75
